import React, { useState, useEffect } from 'react';
import { 
    Table, 
    TableBody, 
    TableCell, 
    TableContainer, 
    TableHead, 
    TableRow, 
    Paper, 
    Container, 
    Typography,
    Button,
    Box,
    Fab
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import { getAllEvents, deleteEvent } from '../services/eventService';
import { useNavigate } from 'react-router-dom';

const EventList = () => {
    const navigate = useNavigate();
    const [events, setEvents] = useState([]);

    const fetchEvents = async () => {
        try {
            const response = await getAllEvents();
            setEvents(response.data);
        } catch (error) {
            console.error('Error fetching events:', error);
            alert('Error loading events. Please try again.');
        }
    };

    useEffect(() => {
        fetchEvents();
    }, []);

    const handleDelete = async (id) => {
        if (window.confirm('Are you sure you want to delete this event?')) {
            try {
                await deleteEvent(id);
                fetchEvents();
                alert('Event deleted successfully!');
            } catch (error) {
                console.error('Error deleting event:', error);
                alert('Error deleting event. Please try again.');
            }
        }
    };

    return (
        <Container maxWidth="lg">
            <Box sx={{ mt: 4, mb: 4, position: 'relative' }}>
                <Typography variant="h4" component="h1" gutterBottom>
                    Events
                </Typography>
                <Fab 
                    color="primary" 
                    aria-label="add"
                    onClick={() => navigate('/events/new')}
                    sx={{ position: 'absolute', top: 0, right: 0 }}
                >
                    <AddIcon />
                </Fab>
                <TableContainer component={Paper}>
                    <Table>
                        <TableHead>
                            <TableRow>
                                <TableCell>ID</TableCell>
                                <TableCell>Club Name</TableCell>
                                <TableCell>Event Title</TableCell>
                                <TableCell>Event Theme</TableCell>
                                <TableCell>Description</TableCell>
                                <TableCell>Contact Email</TableCell>
                                <TableCell>Actions</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {events.map((event) => (
                                <TableRow key={event.postId}>
                                    <TableCell>{event.postId}</TableCell>
                                    <TableCell>{event.clubName}</TableCell>
                                    <TableCell>{event.eventTitle}</TableCell>
                                    <TableCell>{event.eventTheme}</TableCell>
                                    <TableCell>{event.eventDescription}</TableCell>
                                    <TableCell>{event.contactEmail}</TableCell>
                                    <TableCell>
                                        <Button
                                            variant="contained"
                                            color="primary"
                                            size="small"
                                            onClick={() => navigate(`/events/edit/${event.postId}`)}
                                            sx={{ mr: 1 }}
                                        >
                                            Edit
                                        </Button>
                                        <Button
                                            variant="contained"
                                            color="error"
                                            size="small"
                                            onClick={() => handleDelete(event.postId)}
                                        >
                                            Delete
                                        </Button>
                                    </TableCell>
                                </TableRow>
                            ))}
                        </TableBody>
                    </Table>
                </TableContainer>
            </Box>
        </Container>
    );
};

export default EventList;
